import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const MovieList = (props) => (
  <div>
    {props.children}
  </div>
)

class App extends Component {
  render() {
    return (
      <div className="App">
        <MovieList>
          <ul>
            <li>Breaking Bad</li>
            <li>Narcos</li>
            <li>Game of Thrones</li>
          </ul>
        </MovieList>
      </div>
    );
  }
}

export default App;
